import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

const Navbar = () => {
    return (
        <>
            <div className="container-fluid ">
                <div className="row">
                    <div className="col-4"></div>
                    <div className="col-4">
                        E-Menu
                    </div>
                    <div className="col-4">
                        Cart
                    </div>
                </div>
            </div>
        </>
    );
};

export default Navbar;
